from gateway.chartsManager import chart_storage
from nose.tools import assert_equals

def test_store_chart():
    print("List before tests")
    chart_storage.list_charts()
    print("=================")

    do_store_chart({
        "description":"mock description",
        'chart':"<div>Here comes some chart</div>",
        'rendererId':""
    })

    do_store_chart({
        "description":"with bokeh",
        'chart':bokeh_rendering,
        'rendererId':"bokeh"
    })

    print("List after tests")
    chart_storage.list_charts()
    print("=================")

def do_store_chart(payload):
    chart_model = chart_storage.store_chart(payload)
    #check that the chart_model is good
    fetched_model = chart_storage.get_chart(chart_model['CHARTID'])
    assert_equals(payload['chart'], fetched_model['CONTENT'])
    assert_equals( chart_storage.delete_chart(chart_model['CHARTID']), 1)

